import React from 'react';
import { useNavigate } from 'react-router-dom';

const services = [
  { title: 'New in Canada', desc: 'Arrival guide and newcomer essentials', path: '/services/new-to-canada' },
  { title: 'Airport Pickup & Settlement Help', desc: 'Smooth landing and support from day 1', path: '/services/airport-pickup-settlement-help' },
  { title: 'Housing Assistance', desc: 'Shared rooms, rental tips, and landlord advice', path: '/services/housing-assistance' },
  { title: 'SIN, Bank, ID Setup', desc: 'Documents and accounts made easy', path: '/services/sin-bank-id-setup' },
  { title: 'Student Support', desc: 'Colleges, PGWP, study visa help', path: '/services/student-support' },
  { title: 'Job Connection', desc: 'Resumes, job boards, and referrals', path: '/services/job-connection' },
  { title: 'Community Support', desc: 'Meetups, culture and connection', path: '/services/community-support' },
  { title: 'Language Support', desc: 'IELTS prep, French and translation', path: '/services/language-support' },
  { title: 'Nepali Directory', desc: 'Shops, food, services near you', path: '/services/nepali-directory' },
  { title: 'Legal/Immigration Help', desc: 'PR pathway, lawyers and resources', path: '/services/legal-immigration-help' }
];

export default function Dashboard() {
  const navigate = useNavigate();

  return (
    <div className="bg-gray-50 min-h-screen font-sans">
      {/* Top bar */}
      <div className="bg-white shadow p-4 flex justify-between items-center sticky top-0 z-10">
        <h1 className="text-2xl font-bold text-blue-700">ConnectingNepali</h1>
        <button
          onClick={() => {
            localStorage.clear();
            navigate('/');
          }}
          className="bg-red-500 text-white px-4 py-2 rounded hover:bg-red-600"
        >
          Logout
        </button>
      </div>

      {/* Welcome Section */}
      <div className="bg-blue-100 text-center py-10 px-6">
        <h2 className="text-3xl font-bold text-gray-800 mb-2">Welcome, Nepali Immigrants!</h2>
        <p className="text-gray-700 text-lg">Explore essential services, support, and opportunities across Canada.</p>
      </div>

      {/* Services Grid */}
      <div className="px-6 py-10">
        <h3 className="text-2xl font-semibold mb-6">Explore Services</h3>
        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
          {services.map((service, idx) => (
            <div
              key={idx}
              className="bg-white rounded-xl shadow hover:shadow-lg transition p-5 border cursor-pointer"
              onClick={() => navigate(service.path)}
            >
              <h4 className="text-lg font-semibold mb-2">{service.title}</h4>
              <p className="text-gray-600 text-sm">{service.desc}</p>
              <div className="mt-4 text-blue-600 text-sm font-medium hover:underline">Learn More</div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}
